/*!

=========================================================
* Paper Kit React - v1.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/paper-kit-react

* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/paper-kit-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import {React, useCallback} from "react";
import axios from 'axios';

// reactstrap components
import { Button, Card, Form, FormGroup, Input, Container, Row, Col, Modal } from "reactstrap";

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import RegisterModal from "components/RegisterModal";

function RegisterPage() {
  const [registerShow, setRegisterShow] = React.useState(false);
  const [name, setName] = React.useState("");
  const [surname, setSurname] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [jbo, setJbo] = React.useState("");
  const [phone, setPhone] = React.useState("");
  const [adress, setAdress] = React.useState("");
  const [city, setCity] = React.useState("");
  const [state, setState] = React.useState("");

  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("register-page");
    return function cleanup() {
      document.body.classList.remove("register-page");
    };
  });

  /*const sendRegistration = event => {
        event.preventDefault();

        let data = new FormData(event.target);

        axios({
          method: 'post',
          url: 'http://localhost:8088/register',
          data: data
        }).then((response) => {
          console.log(response);
        }, (error) => {
          console.log(error);
        });

        setRegisterShow(false);

  };*/


  return (
    <>

      <ExamplesNavbar showRegister={() => setRegisterShow(true)}/>
      <div
        className="page-header"
        style={{
          backgroundImage: "url(" + require("assets/img/hc-complete-resize.jpg") + ")"
        }}
      >        
      </div>      
      <Modal modalClassName="modal-register" isOpen={registerShow}>

        <div className="modal-header no-border-header text-center">
            <button
              aria-label="Close"
              className="close"
              data-dismiss="modal"
              type="button"
              onClick={() => setRegisterShow(false)}
            >
            <span aria-hidden={true}>×</span>
            </button>
            <h3 className="title mx-auto">Dobrodošli!</h3>
        </div>
        <div className="modal-body">                       
                <Form >
                  <FormGroup>
                  <label>JBO</label>
                  <Input name="jbo" placeholder="jedinstveni broj osiguranika" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Email</label>
                  <Input name="email" placeholder="email" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Ime</label>
                  <Input name="name" placeholder="ime" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Prezime</label>
                  <Input  name="surname" placeholder="prezime" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Lozinka</label>
                  <Input  name="password" placeholder="lozinka" type="password" />
                  </FormGroup>
                  <FormGroup>
                  <label>Potvrdi lozinku</label>
                  <Input placeholder="lozinka" type="password" />
                  </FormGroup>
                  <FormGroup>
                  <label>Telefon</label>
                  <Input  name="phoneNumber" placeholder="telefon" type="text" pattern="[0-9]*" onInput={event => event.validity.valid ? console.log('aa'): console.log('bbba')} />
                  </FormGroup>
                  <FormGroup>
                  <label>Adresa</label>
                  <Input  name="adress" placeholder="adresa" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Grad</label>
                  <Input  name="city" placeholder="grad" type="text" />
                  </FormGroup>
                  <FormGroup>
                  <label>Država</label>
                  <Input  name="state" placeholder="država" type="text" />
                  </FormGroup>                  
                  <Button block className="btn-round" color="info">
                    Registruj se
                  </Button>
                  </Form>

        </div>
        </Modal>


    </>
  );
}

export default RegisterPage;
